import React, { Component } from "react";
import axios from "axios";

export default class Project extends Component {
  componentDidMount() {
    axios
      .get(`/wp-json/wp/v2/project?slug=${this.props.match.params.slug}`)
      .then((res) =>
        this.setState({
          project: res.data,
          isLoaded: true,
        })
      )
      .catch((err) => console.log(err));
  }

  render() {
    return <div></div>;
  }
}
